    "Text recognition for your images" : "Tekstherkenning voor je afbeeldingen",
    "# Description\n\nNextcloud OCR (optical character recognition) processing for images with tesseract-js brings OCR capability to your Nextcloud.\nThe app uses tesseract-js in the browser in order to process images (png, jpeg, tiff, bmp) and saves the output PDF file to the source folder in nextcloud. That for example enables you to search in it.\n\n## Prerequisites, Requirements and Dependencies\nThe OCR app has some prerequisites:\n\n - [Nextcloud 16 and up](https://nextcloud.com/)\n\n - Only supported on latest modern web browsers (Chrome, Edge, Firefox, Opera, Safari*)\n\n - Tesseract traineddata needs about 200 MB space on your server (will be installed automatically).\n\n\n_* On Safari there is currently a problem with the [Content-Security-Policy](https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP), that requires an Administrator to set the 'script-src' to 'unsafe-eval' such that the app works properly. Because this is quite insecure the app itself does not set it and recommends to decide that on your own risk (please make sure, that you know what CSP is and what e.g. unsafe-eval causes)._\n\n## Installation\nInstall the app from the [Nextcloud App Store](https://apps.nextcloud.com/apps/ocr) or download the release package from github (**NOT** the sources) and place the content in **nextcloud/apps/ocr/**.\n\n## Disclaimer\nThe software is distributed on an \"AS IS\" BASIS, WITHOUT WARRANTIES OR\nCONDITIONS OF ANY KIND, either express or implied.\n\n## Note\nThe version 3 and earlier versions are not supported/maintained anymore by the author. So for asynchronous background processing please fork the repository and use the \"not-maintained\" branch to work on improvements. The author wasn't able to support it because of too much effort.\nMoreover this project is based on a webassembly port of tesseract. The maintainer stopped working on PDF processing in this app and will start working on separate app for pdf handling." : "# Beschrijving\n\nNextcloud OCR-verwerking (optische tekenherkenning) voor afbeeldingen met tesseract-js brengt OCR-mogelijkheden naar jouw Nextcloud.\nDe app gebruikt tesseract-js in de browser om afbeeldingen (png, jpeg, tiff, bmp) te verwerken en slaat het uitvoer-PDF-bestand op in de bronmap in nextcloud. Hierdoor kunt u er bijvoorbeeld in zoeken.\n\n## Vereisten, vereisten en afhankelijkheden\nDe OCR-app heeft een aantal vereisten: \n\n- [Volgende wolk 16 en hoger](https://nextcloud.com/)\n- Alleen ondersteund op de nieuwste moderne webbrowsers (Chrome, Edge, Firefox, Opera, Safari*) \n- Tesseract getrainde gegevens hebben ongeveer 200 MB ruimte nodig op uw server (wordt automatisch geïnstalleerd).\n\n\n_* Op Safari is er momenteel een probleem met de [Content-Security-Policy] (https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP), dat vereist dat een Administrator de 'script-src' instelt op 'onveilig-eval' zodat de app goed werkt. Omdat dit vrij onzeker is stelt de app het zelf niet in en raadt aan om dat op eigen risico te beslissen (zorg er alsjeblieft voor, dat je weet wat CSP is en wat bijvoorbeeld unsafe-eval veroorzaakt)._\n\n## Installatie\nInstalleer de app vanuit de [Nextcloud App Store] (https://apps.nextcloud.com/apps/ocr) of download het releasepakket van github (**NOT** de bronnen) en plaats de inhoud in **nextcloud/apps/ocr/**.\n\n## Disclaimer\nDe software wordt gedistribueerd op een \"AS IS\"-BASIS, ZONDER GARANTIES OF\nVOORWAARDEN VAN WELKE AARD DAN OOK, expliciet of impliciet.\n\n## Opmerking\nVersie 3 en eerdere versies worden niet meer ondersteund/onderhouden door de auteur. Dus voor asynchrone achtergrondverwerking kunt u de repository splitsen en de \"niet-onderhouden\" tak gebruiken om aan verbeteringen te werken. De auteur kon het niet ondersteunen vanwege te veel moeite.\nBovendien is dit project gebaseerd op een webassemblagepoort van tesseract. De onderhouder is in deze app gestopt met werken aan PDF-verwerking en gaat aan de slag met een aparte app voor pdf-afhandeling.",
